import { useState } from "react";
import WeatherSearch from './WeatherSearch';

function App() {
  let [city, setCity] = useState("");

  return (
    <div className="App">
      <header className="App-header">
        <h1>Weather App</h1>
       <WeatherSearch city={city} setCity={setCity}/>

      </header>
    </div>
  );
}

export default App;
